(17, 8, 3, 8, 'Bem vamos lá o que eu vi o pessoal falando, falta saida nas cidades e precisa de buracos na cidade com rotworm...<br />\nA mana de ningu?m sobe quando você upa...', '2013-01-24 12:12:56'),
(18, 9, 3, 9, 'Não está dando para colocar arrow no slot, e no site não está dando pra ver as magias das classes.', '2013-01-24 14:05:41'),
(21, 9, 3, 2, 'Olá Aziz,<br />\nprimeiramente nos desculpe pela demora.<br />\n<br />\nObrigado pela sua ajuda nos avisando dos bugs.<br />\nEstamos analisando qual é o motivo da arrow não esta sendo colocada no slot de ammo.<br />\n<br />\nO servidor está em fase de teste até 31/01/2013 e nessa fase esperamos corrigir todos os bugs antes de lança-lo oficialmente. Depois do lançamento você vai continuar com seus personagens e items.<br />\nPor isso suas contribuição nos avisando dos bugs é muito importante.<br />\n<br />\nObrigado pela atenção.', '2013-01-24 15:35:28'),
