(29, 16, 6, 16, 'POderia Colocar UMa Magia q eu vi em um ot ums meses atras mt daora msm q tinha essas vocaçoes novas ,e oq me chamou atençAO<br />\nfoi q o assassin tinha uma magia q ao aplica ela ele se teleporta imediatamente a distance de 4 skm e da um comb de 5 atk em fast atk os atacks do assassin nao pode nao ser forte serto ser mt rapido o atk dele apesar de usa pequenas adagas ,e outra magia q chamou mt atençao uma magia de invisibilidade q deixa o buneco invisivel em 3 seg q da mt bem para despistar os inimigos ,do resto das vocation é so equilibras spero q minhas sugestoes tenhao atitudes brigado adorei o ot msm ,dicas q deu agora sobre magia do assasin veio de um ot mt famoso q centenas de pessoas gostaram ,mas invelismente o servidor nao duro nem 3 semana por causa dos kick e o adk acabou fexando :( infelismente ,mas como apareceu uma nova staff com caapacidade de editar magia e skins boa sorte para vc`s sperto susseço', '2013-01-25 17:51:05'),
