(131, 62, 6, 62, 'Na verdade é uma duvida. Só que nao tinha nenhuma area pra isso então postei aqui. Mas... porque o ot nao é 8.6?', '2013-02-02 20:16:19'),
(132, 62, 6, 8, 'Você pode colocar na aba de observações tudo o que não tem categoria. :)<br />\nO OT não 8.6 por que quando começamos a programar o OT pegamos a versão mais atual de Tibia. Nós temos programadores que são capazes de editar Sprites 9.6, como você pode averiguar algumas mudanças no servidor.<br />\n<br />\nQuais as vantagens de um servidor 8.6 para um 9.6 no seu ponto de vista?', '2013-02-02 20:29:03'),
