(135, 69, 3, 69, 'cara, pelo amor de Deus, tem que ter uma net boa pra ter server on, nao sei se realmente eh isso que acontece, mas seu server trava muito e com apenas dois players, infelizmente nao jogarei mais, mais pense nos novos clientes que tera.', '2013-02-03 19:38:42'),
