(144, 2, 7, 2, 'window.opener.location.href', '2013-02-05 11:39:11'),
(145, 62, 6, 62, 'Sinceramente, Elfbot hahahha<br />\nSei la, gosto até da idéia de um ot sem bot, mas ja tentei e É IMPOSSIVEL. Realmente, quem é que tem tempo e saco pra ficar 12h upando por exemplo. Mesmo que o cara use bot, a maior parte do tempo o cara vai jogar normalmente, só upar mesmo que ele vai usar bot. E treinar tambem. Porque quem é que vai ficar no pc o dia todo vendo o char treinando e ter que voltar de 15 em 15 minutos pra rodar ele? =\\<br />\nE também qual é a diferença exatamente de um 8.6 pra um 9.6? Além daquela barrinha inutil de cooldown e bixos novos? Incluindo sprites. Isso um client próprio resolve.', '2013-02-05 15:07:09'),
(146, 84, 3, 84, 'Nao consigo fazer o download do cliente, quando ficara disponível?', '2013-02-08 11:52:12'),
(147, 15, 6, 15, 'wilds e dwarfians regen de hp de 15 em 15... mana de 5 em 5<br />\ntribais e sorcs regen hp de 5 em 5 e mana de 15 em 15..<br />\nninjas e amazons com regen de hp e mana de 10 em 10', '2013-02-08 13:35:48'),
(148, 15, 6, 15, 'aumentar a recuperaçao de soul', '2013-02-08 13:40:52'),
