(152, 15, 7, 8, 'Você compra P.A. na loja do site, com pontos vip.<br />\nCada um ponto VIP custa 1 R$.<br />\n30 dias P.A. são 10 pontos vip.<br />\n15 dias P.A. são 5 pontos vip.<br />\nComprando pontos vip você ajuda nosso servidor a se manter no ar.', '2013-02-08 21:18:27'),
(153, 4, 2, 99, 'Hunts', '2013-02-09 00:59:41'),
(154, 4, 2, 112, 'Acho que deveria melhorar bastante no detalhamento do mapa, tem muita coisa vazia, e tbm muito quadrado, logo de cara achei bem legal, inicio com detalhes etc, mais dps q andei pra fora do "esgoto" achei muito quadrado e sem detalhe.', '2013-02-10 02:04:31'),
(155, 114, 5, 114, 'poxa esse tibia é muito bom!!!', '2013-02-10 14:25:31'),
