(157, 114, 6, 2, 'Perfeito, vamos buscar desenvolver estes eventos. :D<br />\nObrigado pela sua sugestão.', '2013-02-11 05:53:49'),
(158, 114, 5, 2, 'Obrigado :D', '2013-02-13 01:06:15'),
(159, 2, 3, 2, 'Testando insert', '2013-02-14 18:48:10'),
(160, 306, 3, 306, 'Oi, o comando !promote para guild não funciona. Diz que o player a ser promovido precisa de uma premium account (não Vip, premium) e no server não tem premmy. Enfim, é um erro bobo mas acho que vale a pena a atenção :D', '2013-02-27 06:17:50'),
(161, 332, 6, 332, 'Queria dar uma sugestão do tipo um forum pros usuarios se interagirem e algumas abas de 1º passos dentro do servidor tipo "Fazendo a primeira quest e a segunda"  depois disso parti pra jogo solo algo assim', '2013-02-27 10:14:16'),
(162, 1, 2, 321, 'dawarfian presisa de magias', '2013-02-28 03:52:21'),
(163, 2, 2, 332, 'Sim porque assim creio eu que os jogadores novatos e mesmo os que já tem no servidor saberão que ele sempre esta em andamento ou "VIVO"', '2013-02-28 08:07:01'),
(164, 306, 3, 2, 'Olá, a vip account no servidor é a premmy account.<br />\nVocê pode compra-la pelo site.<br />\n<br />\nApesar disso não tem sentido o comando !promote estar como premmy, já que a criação de guildas é livre.<br />\n<br />\nVamos ajustar esse bug assim que possível. Obrigado por reportar!', '2013-02-28 16:34:03'),
(165, 332, 6, 2, 'Olá, pretendemos sim fazer um forum!<br />\nMas nossos programadores estão com muito trabalho atualmente em projetos pessoais e cursos e por isso esse novo recurso pode demorar um pouco para se tornar disponível.<br />\n<br />\nTambém, por enquanto, nosso foco é o equilíbrio das vocações e lançamento da vocação Monk.<br />\n<br />\nObrigado por sugerir!', '2013-02-28 16:37:09'),
(166, 8, 3, 2, 'Como assim?', '2013-02-28 16:37:59'),
(167, 15, 6, 2, 'Aumentado.', '2013-02-28 16:38:21'),
(168, 1, 2, 336, 'Peguei a classe de dwarf.. e ela em certo nivel.. tira nada de player.. com uma arma mediana.. pois outras classes tem um exura que recupera 10k de vida ;/ ai e tenso.', '2013-03-01 05:29:02'),
(169, 1, 2, 336, 'E concordo na classe Dwarf nao ter muita skill de atc.. mas um "exori" ou algum assim.. não faz mal .. já que na porrada ta dificil de matar tudo .', '2013-03-01 05:57:31'),
(170, 336, 4, 336, 'A classe Dwarf está fraca em Atc corpo a corpo.. e já que nao tem uma magia de atc para ele.. por favor melhorem os ataques dele.. Tenho um dwarf lv 31 .. com uma arma de atc 40 , skill axe 62 .. e tiro no máximo de dragon 100~120 isso quando eu tiro.. que é meio raro..', '2013-03-01 05:59:37'),
(171, 343, 4, 343, 'Boa tarde, estou aqui para falar sobre o dano do dwarfian.<br />\nEle está hitando muito abaixo do padrão de hit, chega a ser abaixo de um hit do wild (pelo que eu li deveria ser maior por ele ser uma vocação de puro dano fisico), queria pedir a vocês que verificassem esse dano dele e ver se realmente tem algum problema e que vocês estivessem corrigindo-o!', '2013-03-02 00:47:40');
