INSERT INTO `market_items` (`idmarketitem`, `vlpreco`, `vlnovopreco`, `dtpromotion`, `txtnome`, `txtdescricao`, `txtimg`, `nriditem`, `nramountperspace`, `isonlyone`, `isbag`, `isbackpack`, `isactive`, `idcategoria`) VALUES
(1, 5, NULL, NULL, '+15 dias de conta vip', 'Com uma conta vip você pode ter acesso a lugares exclusivos, outfits, ter magias exclusivas, promoções para os seus personagem e varias outras coisas!', 'premmy.gif', NULL, 0, 0, 0, 0, 1, 1),
(2, 10, NULL, NULL, 'Aku Aku', '(Armor: 4). Se você já jogou Crash você provavelmente conhece essa mascara. Ela serve como equipamento e também pode conjurar o Aku Aku para que te auxilie recuperando sua vida, sua mana, restaurando sua condição (poison, fire, energy), blocando e ainda te auxiliando no ataque. (Pode ser conjurado de 6 em 6 horas de jogo).', 'aku aku.png', 2628, 1, 1, 0, 0, 1, 2),
(3, 20, NULL, NULL, 'Aku AKu (duplo)', '(Armor: 7). A mascara Aku Aku em sua segunda forma, tem mais vida, recupera mais vida, mais mana, mais forte, mais rápido, é um ótimo auxilio para lugares com monstros fortes ou com um número muito grande monstros. (Pode ser conjurado de 4 em 4 horas de jogo).', 'aku aku double.png', 2630, 1, 1, 0, 0, 1, 2),
(5, 25, NULL, NULL, 'Remover Red Skull', 'Remove a sua red skull (Você precisa estar o personagem deslogado!)', 'red.png', NULL, 1, 1, 0, 0, 0, 3),
(6, 5, 3, '2013-03-01', 'Amulet of Loss', 'Quando você morre, ao invés de perder sua mochila, você perde a AOL.', 'amulets/aol.gif', 2173, 1, 1, 0, 0, 1, 4),
(7, 0.15, NULL, NULL, 'Axe Ring', 'O Axe Ring aumenta seu axe skill em 4 pontos, por 30 minutos.', 'aneis/Axe_Ring.gif', 2208, 1, 0, 1, 1, 1, 5),
(8, 0.15, NULL, NULL, 'Club Ring', 'O Club Ring aumenta seu club skill em 4 pontos por 30 minutos.', 'aneis/Club_Ring.gif', 2209, 1, 0, 1, 1, 1, 5),
(9, 0.15, NULL, NULL, 'Sword Ring', 'O Sword Ring aumenta seu sword skill em 4 pontos por 30 minutos.', 'aneis/Sword_Ring.gif', 2209, 1, 0, 1, 1, 1, 5),
(10, 0.15, NULL, NULL, 'Energy Ring', 'O Energy Ring provém um magic shield por 10 minutos. Muito útil para knights, aumentando um pouco sua defesa. Nota: Esse anel usa sua mana.', 'aneis/Energy_Ring.gif', 2204, 1, 0, 1, 1, 1, 5),
(11, 0.15, NULL, NULL, 'Dwarven Ring', 'Impede de ficar bêbado por 60 minutos. Muito útil para caçar criaturas que deixam bêbado, como Djinns e Ziz.', 'aneis/Dwarven_Ring.gif', 2213, 1, 0, 1, 1, 1, 5),
(12, 0.15, NULL, NULL, 'Time Ring', 'Aumenta sua velocidade em 30 levels por 10 minutos.', 'aneis/Time_Ring.gif', 2169, 1, 0, 1, 1, 1, 5),
(13, 0.15, NULL, NULL, 'Ring of Healing', 'Aumenta a velocidade de regeneração de hp e mp por 7.5 minutos.', 'aneis/Ring_of_Healing.gif', 2214, 1, 0, 1, 1, 1, 5),
(14, 0.15, NULL, NULL, 'Life Ring', 'O anel aumenta mana e vida a cada 6 segundos por 20 minutos.', 'aneis/Life_Ring.gif', 2168, 1, 0, 1, 1, 1, 5),
(15, 0.25, NULL, NULL, 'Might Ring', 'Aumenta a proteção contra todos os elementos em 20%. Possui 20 cargas. Physical +20%, Fire +20%, Earth +20%, Energy +20%, Ice +20%, Holy +20%, e Death +20%.', 'aneis/Might_Ring.gif', 2164, 1, 0, 1, 1, 1, 5),
(16, 0.25, 0.15, '2013-03-01', 'Stealth Ring', 'Deixa você invisível por 10 minutos. Esse item é com certeza uma grande ajuda para caçar criaturas que não são imunes a invisibilidade. A magia Cancel Invisibility não funciona com esse anel.', 'aneis/Stealth_Ring.gif', 2165, 1, 0, 1, 1, 1, 5),
(17, 0.25, NULL, NULL, 'Kit de Sobrevivencia', 'Uma bag com coisas que um jogador pode precisar: 100 rust remover, um dice, uma mechanical fishing rod, um squeezing gear of girlpower, um whacking driller of fate, um sneaky stabber of eliteness e alguma comida.', 'kit.png', NULL, 0, 0, 1, 0, 1, 6),
(18, 10, NULL, NULL, '+30 dias de conta vip', 'Com uma conta vip você pode ter acesso a lugares exclusivos, outfits, ter magias exclusivas, promoções para os seus personagem e varias outras coisas!', 'premmy.gif', NULL, 0, 0, 0, 0, 1, 1),
(19, 0.15, NULL, NULL, 'Temple Rune', '100 runas de templo: essa runa teletransporta o seu personagem para o templo, ele não pode estar em condição de luta para usá-la', 'runas/temple rune.png', 2300, 100, 0, 1, 1, 1, 7),
(20, 0.15, NULL, NULL, 'Common Marking Rune', '100 runas de marcação: com essa runa você pode marcar um ponto no mapa e ser teletransportado para este através do vortex ao lado do deposito na cidade.', 'runas/common marking rune.png', 2280, 100, 0, 1, 1, 1, 7),
(21, 0.75, NULL, NULL, 'Ninja Marking Rune', '100 runas de marcação ninja: essa runa marca uma posição no mapa e com a runa de teletransporte ninja você pode se teletransportar para o local marcado. A marcação no mapa expira em 30 minutos.', 'runas/ninja marking rune.png', 2299, 100, 1, 1, 1, 1, 7),
(22, 1, NULL, NULL, 'Intense Healing Rune', '100 runas de cura intensa: cura o seu personagem.', 'runas/Intense_Healing_Rune_(Item).gif', 2265, 100, 0, 1, 1, 1, 7),
(23, 1, NULL, NULL, 'Chameleon Rune', '100 runas do camaleão: transforma seu personagem em um item.', 'runas/Chameleon_Rune.gif', 2291, 100, 1, 1, 1, 1, 7),
(24, 2, NULL, NULL, 'Ultimate Healing Rune', '100 runas da última cura: recupera a vida do seu personagem.', 'runas/Ultimate_Healing_Rune_(Item).gif', 2273, 100, 1, 1, 1, 1, 7),
(25, 2, NULL, NULL, 'Paralyze Rune', '100 runas de paralisia: deixa o adversário realmente muito lento.', 'runas/Paralyze_Rune.gif', 2278, 1, 1, 1, 1, 1, 7),
(26, 2, NULL, NULL, 'Wild Growth Rune', '100 runas de crescimento selvagem: faz com que uma árvore cresça no local onde a runa for usada.', 'runas/Wild_Growth_Rune.gif', 2269, 1, 1, 1, 1, 1, 7),
(27, 2, NULL, NULL, 'Magic Wall Rune', '100 runas da parede magica: cria uma parede magica no local onde é usada.', 'runas/Magic_Wall_Rune.gif', 2293, 1, 1, 1, 1, 1, 7),
(28, 3, NULL, NULL, 'Ninja Teleport Rune', '100 runas de teletransporte ninja: teletransporta seu personagem para o local marcado com a runa de marcação ninja.', 'runas/teleport rune.png', 2298, 100, 1, 1, 1, 1, 7);
